import React from "react";
import "./Header.css";

const Header: React.FC = () => {
    return (
        <header className="header">
            <h1>GymScout</h1>
            <p>One-stop place for find the best fitness center near you, or anywhere in the world</p>
        </header>
    );
};

export default Header;
